// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface INFTMarket {
    /**
     * Struct representing the NFT listing created by lender
     */
    struct Listing {
        address lender;
        address nftAddress;
        uint256 tokenId;
        uint64 maximumEndTime;
        uint64 minimumDuration;
        uint64 createTime;
        uint64 nonce;
    }

    /**
     * Payment struct
     */
    struct Payment {
        address paymentToken;
        uint256 pricePerDay;
    }

    /**
     * Lender can list NFT on the platform
     */
    function listNFT(
        address nftAddress,
        uint256 tokenId,
        uint64 minimumDuration,
        uint64 maximumEndTime,
        uint256 pricePerDay,
        address paymentToken
    ) external;

    /**
     * Renter can rent NFT
     */
    function rentNFT(
        address nftAddress,
        uint256 tokenId,
        uint64 maximumEndTime,
        uint64 minimumDuration,
        uint256 pricePerDay,
        address paymentToken
    ) external;

    /**
     * Renter returns NFT to the lender, lender gets paid
     */
    function returnRentedNFT(
        address renter,
        address nftAddress,
        uint256 tokenId
    ) external payable returns (uint256 txId);

    /**
     * NFT listing can be cancelled by lender
     */
    function canelNFTListing(address nftAddress, uint256 tokenId) external;

    // Events section
    event ListNFT(
        address lender,
        address nftAddress,
        uint256 tokenId,
        uint64 minimumDuration,
        uint64 maximumEndTime,
        uint256 pricePerDay,
        address paymentToken
    );

    event CancelNFTListing(address lender, address nftAddress, uint256 tokenId);

    event RentNFT(
        address renter,
        address lender,
        address nftAddress,
        uint256 tokenId,
        uint64 startTime,
        uint64 endTime,
        uint256 pricePerDay,
        address paymentToken
    );
}

